import * as React from "react";
import { extendTheme, styled } from "@mui/material/styles";
import DashboardIcon from "@mui/icons-material/Dashboard";
import ShoppingCartIcon from "@mui/icons-material/ShoppingCart";
import BarChartIcon from "@mui/icons-material/BarChart";
import DescriptionIcon from "@mui/icons-material/Description";
import LayersIcon from "@mui/icons-material/Layers";
import { AppProvider } from "@toolpad/core/AppProvider";
import { DashboardLayout } from "@toolpad/core/DashboardLayout";
import { PageContainer } from "@toolpad/core/PageContainer";
import { DataGrid } from "@mui/x-data-grid";
import { getAllTickets } from "./authService";
import TicketDetails from "./TicketDetails";
import { Grid, Card, CardContent, Typography } from "@mui/material";

const NAVIGATION = [
  { kind: "header", title: "Main items" },
  { segment: "dashboard", title: "Tickets", icon: <DashboardIcon /> },
  { segment: "orders", title: "Create", icon: <ShoppingCartIcon /> },
  { kind: "divider" },
  { kind: "header", title: "Billing" },
  {
    segment: "reports",
    title: "Invoices",
    icon: <BarChartIcon />,
    children: [
      { segment: "sales", title: "Open", icon: <DescriptionIcon /> },
      { segment: "traffic", title: "Closed", icon: <DescriptionIcon /> },
    ],
  },
  { segment: "integrations", title: "Ping", icon: <LayersIcon /> },
];

const demoTheme = extendTheme({ colorSchemes: { light: true, dark: true } });

function useDemoRouter(initialPath) {
  const [pathname, setPathname] = React.useState(initialPath);
  return {
    pathname,
    searchParams: new URLSearchParams(),
    navigate: (path) => setPathname(String(path)),
  };
}

export default function DashboardLayoutBasic(props) {
  const { window } = props;
  const router = useDemoRouter("/dashboard");
  const [tickets, setTickets] = React.useState([]);
  const [loading, setLoading] = React.useState(true);
  const [selectedTicket, setSelectedTicket] = React.useState(null);

  React.useEffect(() => {
    const fetchTickets = async () => {
      try {
        const data = await getAllTickets();
        setTickets(data);
      } catch (error) {
        console.error("Failed to fetch tickets:", error.message);
      } finally {
        setLoading(false);
      }
    };

    if (router.pathname === "/dashboard") {
      fetchTickets();
    }
  }, [router.pathname]);

  const columns = [
    { field: "id", headerName: "Ticket ID", width: 150 },
    { field: "ticketStatus", headerName: "Status", width: 150 },
{
  field: "assignee",
  headerName: "Assignee",
  width: 200,
  valueGetter: (params) =>
    params.row.assignee
      ? `${params.row.assignee.firstName || ""} ${params.row.assignee.lastName || ""}`
      : "Unassigned",
},
  ];

  return (
    <AppProvider navigation={NAVIGATION} router={router} theme={demoTheme} window={window}>
      <DashboardLayout>
        <PageContainer>
          <Grid container spacing={2}>
            {router.pathname === "/dashboard" && (
              <>
                <Grid item xs={8}>
                  {loading ? (
                    <p>Loading tickets...</p>
                  ) : (
                    <DataGrid
                      rows={tickets}
                      columns={columns}
                      pageSize={5}
                      rowsPerPageOptions={[5, 10, 20]}
                      autoHeight
                      onRowClick={(params) => setSelectedTicket(params.row)}
                    />
                  )}
                </Grid>

                <Grid item xs={4}>
                  {selectedTicket ? (
                    <TicketDetails ticket={selectedTicket} />
                  ) : (
                    <Card>
                      <CardContent>
                        <Typography>Select a ticket to view details.</Typography>
                      </CardContent>
                    </Card>
                  )}
                </Grid>
              </>
            )}
          </Grid>
        </PageContainer>
      </DashboardLayout>
    </AppProvider>
  );
}
